const versione = '0.1';
var OraAvvio;
var OraUltimoControllo;
var ElencoSlot = [];
var DataProxRefresh;

const ScrittaNessunoSlot = '<div style="text-align: center; font-size: 120%"><div style="font-size: 300%; font-weight: bold; color: gray; font-family: helvetica">Ø</div>Non ho trovato slot prenotabili su questa agenda!</div>';

const SuonoPrenotazioneFatta = 'data:audio/mpeg;base64,';
const SuonoNuovoSlotPubblicato = 'data:audio/mpeg;base64,';
//credits: https://notificationsounds.com/

(async function()
 {
    'use strict';
    OraAvvio = new Date();

    await VerificaCaricamentoPagina();
    CaricaUI();
    CaricaImpostazioni();
    await VerificaCaricamentoAgenda();

    await ElencaSlot();
    await EseguiPrenotazioni();

    CalcolaProssimoRiavvio();
    await AttendiProssimoRiavvio();
})();


async function VerificaCaricamentoPagina()
{
    Attività('Caricamento pagina...');
    while(true)
    {
        var OraAttuale = new Date();
        var DurataCaricamento = OraAttuale.getTime() - OraAvvio.getTime();

        // Cerca di trovare un elemento che c'è sempre nella pagina; se è diverso da null, possiamo uscire con successo
        if(document.querySelector("#agtitle") != null || document.querySelector("#agtext") != null)
        {
            //Pagina caricata con successo dopo DurataCaricamento ms
            return;
        }

        // Non sono uscito dal ciclo: vuol dire che la pagina non si è ancora caricata

        // Nel caso in cui il server risponda errore 503 (viene caricata una pagina con scritto solo "The service is unavailable"), ricarico la pagina
        const Corpo503Old = 'The service is unavailable.';
        const Corpo503New = `<h2>Service Unavailable</h2>
<hr><p>HTTP Error 503. The service is unavailable.</p>
`;
        const Title503 = 'Service Unavailable';

        if(document.body.innerHTML == Corpo503Old || document.body.innerHTML == Corpo503New || document.title == Title503) await RicaricaPagina();

        //Se non è siccesso niente ma è passato troppo tempo, ricarico
        if(DurataCaricamento > 20000) await RicaricaPagina();

        await sleep(1000); //attendi 1 secondo che la pagina si carichi
    }
}

async function VerificaCaricamentoAgenda()
{
    var CountFallimenti = 0;
    var ElementoTitolo, Titolo, DurataCaricamento;
    while(true)
    {
        Attività('Caricamento agenda (' + (CountFallimenti+1) + '° tentativo)');
        if(CountFallimenti >= 15) await RicaricaPagina(); //Agenda non ancora caricata dopo 15 tentativi

        await sleep(1000); //attendi 1 secondo che la pagina si carichi

        ElementoTitolo = document.querySelector("#agtext");
        if (ElementoTitolo == null)
            { CountFallimenti++; continue; }
        else
        {
            Titolo = ElementoTitolo.innerHTML;

            if(Titolo == 'Nessuna descrizione')
                { CountFallimenti++; continue; }
            else
            {
                // Controllo che ci siano degli slot nelle 10 settimane successive o precedenti
                var BottoneAvanti = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > div > button.fc-next-button.fc-button.fc-button-primary");
                var BottoneIndietro = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > div > button.fc-prev-button.fc-button.fc-button-primary");
                var BottoneOggi = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > button");

                var trovato = false;

                //Controllo settimane successive
                for(var spostamenti=0; spostamenti < 10; spostamenti++)
                {
                    if(CiSonoCaselleNellaSettimana() == true) { trovato = true; break; }
                    else await BottoneIndietro.click();
                }
                await BottoneOggi.click();

                if(!trovato)
                {
                    //Controllo settimane precedenti
                    for(spostamenti=0; spostamenti < 10; spostamenti++)
                    {
                        if(CiSonoCaselleNellaSettimana() == true) { trovato = true; break; }
                        else await BottoneIndietro.click();
                    }
                    await BottoneOggi.click();
                }

                if(!trovato) //Il titolo dell'agenda si è caricato, ma non ci sono i riquadri per prenotare, nemmeno nelle settimane precedenti/successive
                {
                    CountFallimenti++;
                    continue;
                }
                else { //Agenda caricata!
                    break;
                }
            } //fine if(Titolo != 'nessuna descrizione')
        } //fine if(ElementoTitolo != null)
    } //fine while


    // Cambio titolo della finestra
    document.title = document.getElementById('agtitle').innerHTML + ' [prenotatore ' + versione + ']';
}

