function CaricaImpostazioni()
{
    const ElencoSlotStr = localStorage.getItem('ElencoSlot');
    if(ElencoSlotStr != null && ElencoSlotStr != '') ElencoSlot = JSON.parse(ElencoSlotStr);

    const FrequenzaStr = localStorage.getItem('frequenza');
    if(FrequenzaStr != null) CambiamentoFrequenza(Number(FrequenzaStr));

    document.getElementById('PrenotaNuoviSlot').checked = (localStorage.getItem('PrenotaNuoviSlot') == 'true');
}

async function ElencaSlot()
{
    var BottoneAvanti = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > div > button.fc-next-button.fc-button.fc-button-primary");
    var BottoneIndietro = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > div > button.fc-prev-button.fc-button.fc-button-primary");
    var BottoneOggi = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > button");
    await BottoneOggi.click();

    const PrenotareDefault = (localStorage.getItem('PrenotaNuoviSlot') == 'true');

    var NuovoElencoSlot = [];
    var NuovoHTMLElencoSlot = '';
    var i = 0;

    for(var s=0; s <= 13; s++)
    {
        for(var g=0; g<7; g++)
        {
            var t=0;
            while(true)
            {
                var ElemSlot = RestituisciElementoTurno(g, t);
                if(ElemSlot == null) break;
                if(ElemSlot.classList.contains('ag-slot-passed') ) { t++; continue; }

                const DataSlot = GetDataAssoluta(g);
                const OraSlot = ElemSlot.querySelector('div > div.fc-time > span').innerHTML;
                const SlotPrecedente = GetSlot(DataSlot, OraSlot);
                if(SlotPrecedente == null)
                {
                    var suono = new Audio(SuonoNuovoSlotPubblicato);
                    suono.play();
                }

                const NumLiberi = GetPostiLiberi(ElemSlot);
                var ElemTitolo = ElemSlot.querySelector('div > div.fc-title');
                const TitoloSlot = (ElemTitolo != null ? ElemTitolo.innerHTML : '');

                var elem = { data: DataSlot,
                            ora: OraSlot,
                            titolo: TitoloSlot,
                            PostiLiberi: NumLiberi,
                            prenotare: (SlotPrecedente != null ? SlotPrecedente.prenotare : PrenotareDefault),
                            prenotato: ElemSlot.classList.contains('ag-slot-mine'),
                            dataPrenotazione: (SlotPrecedente != null ? SlotPrecedente.dataPrenotazione : null) };
                NuovoElencoSlot.push(elem);

                const coloriPosti = ColorePosti(NumLiberi, Number(ElemSlot.querySelector('div > div.ag-cnt > span.ag-max').innerHTML) );

                var coloreSfondo;
                if(elem.prenotato) coloreSfondo = 'lightgreen';
                else if(elem.prenotare) coloreSfondo = 'orangered';
                else coloreSfondo = 'unset';

                NuovoHTMLElencoSlot +=
                `<label style="display: block; padding: 5px; background-color: ` + coloreSfondo + `">
                    <input type="checkbox" style="vertical-align: top" id="CheckboxSlot` + i + `" />
			        <div style="display: inline-block; max-width: 90%;">` + DataSlot.getDate() + ' ' + DaNumeroANomeMese(DataSlot.getMonth()) + ' ' + (DataSlot.getFullYear()-2000) + ' 🕖' + OraSlot +
                    '<span style="background-color: ' + coloriPosti[0] + '; color: ' + coloriPosti[1] + '; border-radius: 3px; padding: 3px; margin-left: 5px"><b>' + NumLiberi + '</b> liberi</span>' +
                    (TitoloSlot != '' ? '<div style="color: darkviolet; font-weight: bold;">' + TitoloSlot + '</div>' : '') +
                    (elem.prenotato ? '<div>✔️Prenotato' + (elem.dataPrenotazione != null ? 'alle ' + FormattaData(elem.dataPrenotazione) : '') + '</div>' : '') +
                    `</div>
                </label>`;
                i++;

                t++;
            }
        }
        await BottoneAvanti.click();
    }

    if(NuovoHTMLElencoSlot != '')
    {
        document.getElementById('ElencoSlot').innerHTML = NuovoHTMLElencoSlot;
        for(i=0; i<NuovoElencoSlot.length; i++)
        {
            document.getElementById('CheckboxSlot' + i).checked = NuovoElencoSlot[i].prenotare;
            document.getElementById('CheckboxSlot' + i).addEventListener('click', ClickCasellaSlot.bind(null, i));
        }
    } else document.getElementById('ElencoSlot').innerHTML = ScrittaNessunoSlot;

    ElencoSlot = NuovoElencoSlot;
    localStorage.setItem('ElencoSlot', JSON.stringify(ElencoSlot));
    BottoneOggi = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > button");
    await BottoneOggi.click();
}

async function EseguiPrenotazioni()
{
    OraUltimoControllo = new Date();
    //TODO

    //var suono = new Audio(SuonoPrenotazioneFatta);
    //suono.play();
}

function CalcolaProssimoRiavvio()
{
    var HoQualcosaDaFare;
    if(localStorage.getItem('PrenotaNuoviSlot') == 'true') HoQualcosaDaFare = true;
    else
    {
        HoQualcosaDaFare = false;
        for(var i=0; i < ElencoSlot.length; i++)
        {
            if(ElencoSlot[i].prenotare && !ElencoSlot[i].prenotato) { HoQualcosaDaFare = true; break; }
        }
    }

    if(!HoQualcosaDaFare)
    {
        document.getElementById('ON').style.display = 'none';
        document.getElementById('OFF').style.display = 'block';
        Attività('niente da fare');
        DataProxRefresh = null;
    }
    else {
        document.getElementById('ON').style.display = 'block';
        document.getElementById('OFF').style.display = 'none';

        const frequenza = GetFrequenzaControlliMinuti() * 60000;
        DataProxRefresh = new Date(OraUltimoControllo.getTime() + frequenza);
        Attività('attendo prossimo aggiornamento pagina (' + DataProxRefresh.getHours() + ':' + (DataProxRefresh.getMinutes() < 10 ? '0' : '') + DataProxRefresh.getMinutes() + ')');
    }
}

async function AttendiProssimoRiavvio()
{
    while(true)
    {
        var TempoSospensione;
        if(DataProxRefresh == null) TempoSospensione = 15000;
        else
        {
            const MsMancanti = DataProxRefresh.getTime() - (new Date()).getTime();
            if(MsMancanti < 0) { await RicaricaPagina(); break; }
            else if(MsMancanti < 15000) TempoSospensione = MsMancanti;
            else TempoSospensione = 15000;
        }
        await sleep(TempoSospensione);
    }
}

function FormattaData(data)
{
    return data.getHours() + (data.getMinutes() < 10 ? ':0' : ':') + data.getMinutes() + ' ' + data.getDate() + ' ' + DaNumeroANomeMese(data.getMonth());
}

function ClickCasellaSlot(indice)
{
    var CheckBox = document.getElementById('CheckboxSlot' + indice);
    var casella = CheckBox.parentElement;

    ElencoSlot[indice].prenotare = CheckBox.checked;
    localStorage.setItem('ElencoSlot', JSON.stringify(ElencoSlot));

    if(ElencoSlot[indice].prenotato == true) casella.style.backgroundColor = 'lightgreen';
    else if(ElencoSlot[indice].prenotare == true) casella.style.backgroundColor = 'orangered';
    else casella.style.backgroundColor = 'unset';

    CalcolaProssimoRiavvio();
}

function ClickPrenotaNuoviSlot()
{
    localStorage.setItem('PrenotaNuoviSlot', document.getElementById('PrenotaNuoviSlot').checked);
    CalcolaProssimoRiavvio();
}

function CambiamentoFrequenza(ForzaLivello)
{
    var Slider = document.getElementById('FrequenzaSlider');
    var Label = document.getElementById('FrequenzaLabel');
    var livello = (ForzaLivello != null ? ForzaLivello : Slider.value);
    Slider.value = livello;
    if(ForzaLivello == null) localStorage.setItem('frequenza', livello);
    if(ForzaLivello == null) CalcolaProssimoRiavvio();

    if(livello == -3)
    {
        Label.innerHTML = 'ogni ora';
        Label.style.color = 'lightgreen';
        Slider.style.background = 'lightgreen';
    } else if(livello == -2)
    {
        Label.innerHTML = 'ogni 20 minuti';
        Label.style.color = '#3EBE00';
        Slider.style.background = '#3EBE00';
    } else if(livello == -1)
    {
        Label.innerHTML = 'ogni 8 minuti';
        Label.style.color = 'green';
        Slider.style.background = 'green';
    } else if(livello == 0)
    {
        Label.innerHTML = 'ogni 3 minuti';
        Label.style.color = '#005CC8';
        Slider.style.background = '#005CC8';
    } else if(livello == 1)
    {
        Label.innerHTML = 'ogni 1 minuto e 30';
        Label.style.color = '#BFBF00';
        Slider.style.background = '#FFE118';
    } else if(livello == 2)
    {
        Label.innerHTML = 'ogni 45 secondi';
        Label.style.color = '#FF8100';
        Slider.style.background = '#FF8100';
    } else if(livello == 3)
    {
        Label.innerHTML = 'ogni 15 secondi';
        Label.style.color = '#E10000';
        Slider.style.background = '#E10000';
    }
}

function GetFrequenzaControlliMinuti()
{
    const storage = localStorage.getItem('frequenza');
    if(storage == null) return 5;
    else
    {
        if(Number(storage) == -3) return 60;
        else if(Number(storage) == -2) return 20;
        else if(Number(storage) == -1) return 8;
        else if(Number(storage) == 0) return 3;
        else if(Number(storage) == 1) return 1.5; //1 minuto e 30
        else if(Number(storage) == 2) return 0.75; //45 secondi
        else if(Number(storage) == 3) return 0.25; //15 secondi
    }
}

async function RicaricaPagina()
{
    Attività('Ricarico la pagina');

    // Ordina il refresh e cicla finché la pagina non si è ricaricata
    while(true)
    {
        window.location.reload();
        await sleep(30000);
    }
}

function GetSlot(DataSlot, OraSlot)
{
    for(var i=0; i<ElencoSlot.length; i++)
    {
        const data = new Date(ElencoSlot[i].data);
        if(data.getTime() == DataSlot.getTime() && ElencoSlot[i].ora == OraSlot) return ElencoSlot[i];
    }
    return null; //non trovato
}

function ColorePosti(liberi, totali)
{
    if(liberi < 0) return ['black', 'white'];
    else if(liberi == 0) return ['darkred', 'white'];
    else if(liberi < 0.1*totali) return ['red', 'white'];
    else if(liberi < 0.3*totali) return ['orange', 'black'];
    else if(liberi < 0.5*totali) return ['yellow', 'black'];
    else if(liberi < 0.66*totali) return ['#99DE00', 'black'];
    else if(liberi < 0.85*totali) return ['#00C200', 'white'];
    else return ['#008250', 'white'];
}

function GetPostiLiberi(elemento)
{
    var ElemOccupati = elemento.querySelector('div > div.ag-cnt > span.ag-taken');
    var ElemTotali = elemento.querySelector('div > div.ag-cnt > span.ag-max');
    if(ElemOccupati == null || ElemTotali == null || ElemOccupati.innerHTML == '' || ElemTotali.innerHTML == '') return '?';
    else return (Number(ElemTotali.innerHTML) - Number(ElemOccupati.innerHTML) );
}

function GetDataAssoluta(GiornoSettimana)
{
    var RetVal = LunedìSettimanaVisualizzata();
    //alert('LunedìSettimanaVisualizzata: ' + RetVal);
    RetVal.setDate(RetVal.getDate() + GiornoSettimana);
    //alert('+' + GiornoSettimana + ': ' + RetVal);
    return RetVal;
}

function LunedìSettimanaVisualizzata()
{
    const StringaSettimana = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-center > h2").innerHTML;
    const StringaDomenica = StringaSettimana.split(' – ')[1];
    const giorno = Number(StringaDomenica.split(' ')[0]);
    const meseStringa = StringaDomenica.split(' ')[1];
    const mese = DaNomeANumeroMese(meseStringa) - 1;
    const anno = Number(StringaDomenica.split(' ')[2]);

    var data = new Date(anno, mese, giorno);
    data.setDate(data.getDate() - 6);
    return data;
}

function DaNomeANumeroMese(StringaMese)
{
    if(StringaMese == 'gen') return 1;
    else if(StringaMese == 'feb') return 2;
    else if(StringaMese == 'mar') return 3;
    else if(StringaMese == 'apr') return 4;
    else if(StringaMese == 'mag') return 5;
    else if(StringaMese == 'giu') return 6;
    else if(StringaMese == 'lug') return 7;
    else if(StringaMese == 'ago') return 8;
    else if(StringaMese == 'set') return 9;
    else if(StringaMese == 'ott') return 10;
    else if(StringaMese == 'nov') return 11;
    else if(StringaMese == 'dic') return 12;
}

function DaNumeroANomeMese(NumeroMese)
{
    if(NumeroMese == 0) return 'gen';
    else if(NumeroMese == 1) return 'feb';
    else if(NumeroMese == 2) return 'mar';
    else if(NumeroMese == 3) return 'apr';
    else if(NumeroMese == 4) return 'mag';
    else if(NumeroMese == 5) return 'giu';
    else if(NumeroMese == 6) return 'lug';
    else if(NumeroMese == 7) return 'ago';
    else if(NumeroMese == 8) return 'set';
    else if(NumeroMese == 9) return 'ott';
    else if(NumeroMese == 10) return 'nov';
    else if(NumeroMese == 11) return 'dic';
}

function Attività(stringa)
{
    var elem = document.getElementById('attività');
    if(elem != null) elem.innerHTML = stringa;
}

function CiSonoCaselleNellaSettimana()
{
// Restituisce true se nella settimana visualizzata c'è almeno una casella/link (compare almeno una casella/link per prenotarsi), false se è tutta vuota
    for(var i = 0; i < 7; i++)
        { if(RestituisciElementoTurno(i, 0) != null) return true; }
    return false;
}

function RestituisciElementoTurno(GiornoSettimana, Turno)
{
//GiornoSettimana: 0=lunedì ... 6=domenica
//Turno: 0, 1, 2, 3...
    const NumeroColonna = GiornoSettimana + 2;
    //NumeroColonna: 2=lunedì ... 8=domenica
    return document.querySelector('#calendar > div.fc-view-container > div > table > tbody > tr > td > div.fc-scroller.fc-time-grid-container > div > ' +
           'div.fc-content-skeleton > table > tbody > tr > td:nth-child(' + NumeroColonna + ') > div > div:nth-child(2) > a:nth-child(' + (Turno+1) + ')');
}

function sleep(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}